// Flatten all data objects from the wrapped "success/data" structure
const transcripts = items.map(item => item.json.data);

// Sort by dateString descending
transcripts.sort((a, b) => new Date(b.dateString) - new Date(a.dateString));

// Pick the most recent
const latest = transcripts[0];

// Return transcript ID and relevant info
return [
  {
    json: {
      transcript_id: latest.id,
      title: latest.title,
      meeting_date: latest.dateString,
      organizer_email: latest.organizer_email,
      meeting_link: latest.meeting_link
    }
  }
];

